import {StyledTitle,Avatar} from "./../components/Styles";

//logo
import Logo from "./../assets/logo.png";

const Home = () => {
    return(
        <div>
            <div>
                <Avatar image={Logo}/>
            </div>
            <StyledTitle size={65}>
                Welcome to myProject
            </StyledTitle>
        </div>
    );
}

export default Home;
